import { Component } from '@angular/core';
import { UserbackService } from '../Services/userback.service';
import { User } from '../Models/user.model'; // Adjust the path as per your model setup

@Component({
  selector: 'app-status',
  templateUrl: './status.component.html',
  styleUrls: ['./status.component.css']
})
export class StatusComponent {
  user: User = new User(); // Initialize an empty User object or use a form model

  constructor(private userbackService: UserbackService) { }

  onSubmit(): void {
    this.userbackService.addUser(this.user).subscribe(
      response => {
        console.log('User added successfully!', response);
        // Optionally, you can reset the form or handle success message here
      },
      error => {
        console.error('Error adding user:', error);
        // Handle error message or show an alert to the user
      }
    );
  }
}
